"use strict";$(document).ready(function(){new Swiper(".main-slider",{slidesPerView:1,direction:"horizontal",loop:!1,effect:"fade",fadeEffect:{crossFade:!0},navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"}});$('select[name="your-region"]').select2(),document.querySelectorAll(".form-tab").forEach(e=>{e.addEventListener("click",e=>{e.preventDefault(),e.currentTarget.parentNode.classList.contains("tab-changed"),e.currentTarget.parentNode.classList.add("active"),e.currentTarget.nextElementSibling.classList.remove("active"),e.currentTarget.classList.add("active")})})});